('9006239f782246c5b17c33f5f76933f6','seanwes podcast ','Sean McCabe and Ben Toalson','https://cdn-images-1.listennotes.com/podcasts/seanwes-podcast-sean-mccabe-and-ben-toalson-pmTHCb-nJF_.300x300.jpg','https://cdn-images-1.listennotes.com/podcasts/seanwes-podcast-sean-mccabe-and-ben-toalson-pmTHCb-nJF_.300x300.jpg','https://www.listennotes.com/c/9006239f782246c5b17c33f5f76933f6/','494','Build and grow a sustainable business. From products and marketing to professionalism and clients, you’ll get answers to the hard-hitting questions.  Join entrepreneurs Sean McCabe and Ben Toalson as they let you inside their discussions on the many facets of making a living online. You’ll come away from every episode with something of value that you can apply to your business.',685421236,'','English','http://seanwes.com/podcast?utm_source=listennotes.com&utm_campaign=Listen+Notes&utm_medium=website',0,0,'episodic','us','Migration'),
('a706b0a930b24e269bcf177432ce5ac6','The Changelog: Software Dev & Open Source','Changelog Media','https://cdn-images-1.listennotes.com/podcasts/the-changelog-changelog-media-7o41SvyO8z_.300x300.jpg','https://cdn-images-1.listennotes.com/podcasts/the-changelog-changelog-media-7o41SvyO8z_.300x300.jpg','https://www.listennotes.com/c/a706b0a930b24e269bcf177432ce5ac6/','408','Conversations with the hackers, leaders, and innovators of software development.  Hosts Adam Stacoviak and Jerod Santo face their imposter syndrome so you don’t have to. Expect in-depth interviews with the best and brightest in software engineering, open source, and leadership. This is a polyglot podcast. All programming languages, platforms, and communities are welcome. Open source moves fast. Keep up.',341623264,'','English','https://changelog.com/podcast?utm_source=listennotes.com&utm_campaign=Listen+Notes&utm_medium=website',1,0,'episodic','us','Migration'),
('083e27920aa049c7a4b035f3acb24272','Syntax - Tasty Web Development Treats','Wes Bos & Scott Tolinski - Full Stack JavaScript Web Developers','https://cdn-images-1.listennotes.com/podcasts/syntax-tasty-web-development-treats-wes-bos-HBLGrV82oAs.300x300.jpg','https://cdn-images-1.listennotes.com/podcasts/syntax-tasty-web-development-treats-wes-bos-HBLGrV82oAs.300x300.jpg','https://www.listennotes.com/c/083e27920aa049c7a4b035f3acb24272/','262','Full Stack Developers Wes Bos and Scott Tolinski dive deep into web development topics, explaining how they work and talking about their own experiences. They cover from JavaScript frameworks like React, to the latest advancements in CSS to simplifying web tooling.',1253186678,'http://feed.syntax.fm/rss','English','https://syntax.fm?utm_source=listennotes.com&utm_campaign=Listen+Notes&utm_medium=website',0,0,'episodic','us','Migration'),
('a9bd8a40e25e461292ad49a903c58de4','Wireframe','Adobe','https://cdn-images-1.listennotes.com/podcasts/wireframe-adobe-Ex8uh7HATgP-oqX5WKphdUj.300x300.jpg','https://cdn-images-1.listennotes.com/podcasts/wireframe-adobe-Ex8uh7HATgP-oqX5WKphdUj.300x300.jpg','https://www.listennotes.com/c/a9bd8a40e25e461292ad49a903c58de4/','17','Wireframe reveals the stories behind user experience design, for UX/UI designers, graphic designers, and the design-curious. Hosted by Khoi Vinh, principal designer at Adobe and one of Fast Company’s 100 Most Creative People in Business, the podcast explores unexpected ways that user experience design helps technology fit into our lives.',1437677219,'','English','https://xd.adobe.com/ideas/perspectives/wireframe-podcast/?utm_source=listennotes.com&utm_campaign=Listen+Notes&utm_medium=website',0,0,'episodic','us','Migration'),
